import React from "react";
import "./style.css";
import PropTypes from 'prop-types';

function Form({ onSubmit, label, types, required }) {
  return (
    <form onSubmit={onSubmit}>
      <label>{label}</label>
      <input type={types} required={required} />
      {React.children.map(children => {
        if (!React.Children.only(children, 'input')) {
          return children;
        }
        return (
          <div key='input'>
            <input type={types} required={required} />
          </div>
        );
      }, this)}
      <input type='submit' />
    </form>
  );
}

Form.propTypes = {
  onSubmit: PropTypes.func.isRequired,
  label: PropTypes.string.isRequired,
  types: PropTypes.string.isRequired,
  required: PropTypes.Boolean.isRequired
};

export default Form;
